import {  StyleSheet, Text, View } from 'react-native';


const styles = StyleSheet.create({
    container: {
      flex: 8,
      backgroundColor: '#cdcdcd',
    },
    content: {
      flex: 8,
      backgroundColor: '#cdcdcd',
      justifyContent: 'center',
      alignItems: 'center',
      margin: 'auto',
    },
    button: {
      width: 100,
      height: 40,
      padding: 10,
      textAlign: 'center',
      
    },




    footer: {
      height: 40,
      bottom: 0,
      padding: 10,
      textAlign: 'center',
      
    },
    footer_text: {
      height: 40,
      textAlign: 'center',
      
    },
  });


export { styles };
